import './App.css';
import InputArea from './templates/InputArea';
import ButtonPropt from './templates/ButtonPropt';
import TableFunc from './templates/TableFunc';

var row = 1
var column = 3
var columnHeaders =["Parameters","Weight (0-10)","Alternative 1"];

function App() {
  return (
    <div className="Field">
      <h1>Kepner-Tregoe Method</h1>
      <div className="First-Buttons-Part">
        <ButtonPropt name="Add Parameter" bgColor="lightblue"/>
        <ButtonPropt name="Add Alternative" bgColor="lightblue"/>

      </div>
      <div className="Input-Area">
        <TableFunc rowSize={row} columnSize={column}/>
      </div>
      <div className="Second-Buttons-Part">
        <ButtonPropt name="Calculate" bgColor="yellowgreen"/>
        <ButtonPropt name="Reset Form" bgColor="yellow" color="black"/>
      </div>
    </div>
  );
}

export default App;
